question.fine_print:
An "offer" is defined as a formal proposal of monetary or any other consideration (including trades) by the US that, if accepted by Denmark, would lead to Denmark transferring [sovereignty](https://www.britannica.com/topic/sovereignty) of greater than 50% of the land area of Greenland to the US.&#x20;

Note that anything other than a purchase of sovereignty (for example a purchase of mineral rights or military base rights) does not count.&#x20;

Statements such as "Greenland is not for sale" do not count; the US must make a formal offer as described above.&#x20;
